package circuits

import (
	"testing"
)

type StoreProof struct {
	Period  uint64 `json:"period"`
	Proof   []byte `json:"proof"`
	Witness []byte `json:"witness"`
}

func TestCircuit(t *testing.T) {
	witness, err := HexToWitness("")
	if err != nil {
		t.Fatal(err)
	}
	vector := witness.Vector()
	t.Log(vector)
	bigInts, err := HexWitnessToBigInts("")
	if err != nil {
		t.Fatal(err)
	}
	t.Log(bigInts)
}
